import React from 'react';
import { StyleSheet, Text, View, TextInput, TouchableOpacity } from 'react-native';
import { SearchBar, AirbnbRating } from 'react-native-elements';

// export default class App extends React.Component {
//   state = {
//     email: "",
//     password: ""
//   }

// render() {

const Cl_Review = ({ navigation }) => {
    const [value, setValue] = React.useState("");
    return (
        <View style={styles.container}>
            <Text style={styles.logo}>Add Review</Text>
            <View style={styles.inputView} >
                <TextInput
                    style={styles.inputText}
                    placeholder="Username..."
                    placeholderTextColor="white"
                //onChangeText={text => this.setState({ email: text })} 
                />
            </View>
            <View style={styles.inputView} >
                <TextInput
                    style={styles.inputText}
                    placeholder="Email..."
                    placeholderTextColor="white"
                //onChangeText={text => this.setState({ password: text })}
                />
            </View>
            <View  >
                <SearchBar style={styles.container}
                    platform="ios"
                    onChangeText={newVal => setValue(newVal)}
                    onClearText={() => console.log(onClearText())}
                    placeholder="Select Lawyer..."
                    placeholderTextColor="white"
                    cancelButtonTitle="Cancel"
                    cancelButtonProps={{}}
                    onCancel={() => console.log("")}
                    value={value}
                />
                <Text> </Text>
            </View>

            <View style={styles.ReviewBox} >
                <TextInput
                    style={styles.inputText}
                    placeholder="Enter Text..."
                    placeholderTextColor="white"
                //onChangeText={text => this.setState({ password: text })}
                />
            </View>

            <AirbnbRating
                count={5}
                defaultRating={1}
                reviews={[
                    "Terrible",
                    "Bad",
                    "Okay",
                    "Good",
                    "Great"
                ]}
                onFinishRating={() =>
                    console.log("onFinishRating()")
                }
                showRating
            />

            <TouchableOpacity onPress={() => navigation.navigate("Lawyer")}
                style={styles.loginBtn}>
                <Text style={styles.loginText}>Submit Review</Text>
            </TouchableOpacity>


        </View>
    );
};

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#003f5c',
        alignItems: 'center',
        justifyContent: 'center',
    },
    logo: {
        fontWeight: "bold",
        fontSize: 50,
        color: "#fb5b5a",
        marginBottom: 40
    },
    inputView: {
        width: "80%",
        backgroundColor: "#465881",
        borderRadius: 25,
        height: 50,
        marginBottom: 20,
        justifyContent: "center",
        padding: 20
    },
    inputText: {
        height: 50,
        color: "white"
    },
    loginBtn: {
        width: "80%",
        backgroundColor: "#fb5b5a",
        borderRadius: 25,
        height: 50,
        alignItems: "center",
        justifyContent: "center",
        marginTop: 40,
        marginBottom: 10
    },
    loginText: {
        color: "white"
    },
    ReviewBox: {
        width: "100%",
        backgroundColor: "#465881",
        borderRadius: 25,
        height: 100,
        marginBottom: 20,
        justifyContent: "center",
        padding: 10
    },

});

export default Cl_Review;
